import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { RootState } from './app/store';
import { setCryptos, updateCryptoPrice } from './features/crypto/cryptoSlice';
import './App.css';

const mockCryptoData = [
  { id: 'bitcoin', name: 'Bitcoin', symbol: 'BTC', price: 35000, change24h: 2.5, marketCap: 680000000000, volume24h: 28500000000 },
  { id: 'ethereum', name: 'Ethereum', symbol: 'ETH', price: 2000, change24h: 1.8, marketCap: 240000000000, volume24h: 15700000000 },
  { id: 'cardano', name: 'Cardano', symbol: 'ADA', price: 1.2, change24h: -0.5, marketCap: 40000000000, volume24h: 1200000000 },
  { id: 'solana', name: 'Solana', symbol: 'SOL', price: 98, change24h: 3.2, marketCap: 42000000000, volume24h: 2100000000 },
  { id: 'polkadot', name: 'Polkadot', symbol: 'DOT', price: 15.8, change24h: -1.2, marketCap: 18500000000, volume24h: 980000000 },
  { id: 'avalanche', name: 'Avalanche', symbol: 'AVAX', price: 35.4, change24h: 4.1, marketCap: 12800000000, volume24h: 890000000 },
  { id: 'chainlink', name: 'Chainlink', symbol: 'LINK', price: 14.2, change24h: 0.8, marketCap: 8200000000, volume24h: 650000000 }
];

function App() {
  const dispatch = useDispatch();
  const { cryptos } = useSelector((state: RootState) => state.crypto);

  useEffect(() => {
    // Initialize with mock data
    dispatch(setCryptos(mockCryptoData));

    // Simulate real-time updates
    const interval = setInterval(() => {
      mockCryptoData.forEach(crypto => {
        const randomChange = (Math.random() - 0.5) * 2; // Random price change between -1% and 1%
        const newPrice = crypto.price * (1 + randomChange / 100);
        dispatch(updateCryptoPrice({
          id: crypto.id,
          price: newPrice,
          change24h: crypto.change24h + randomChange / 4,
        }));
      });
    }, 3000);

    return () => clearInterval(interval);
  }, [dispatch]);

  const formatNumber = (num: number, decimals: number = 2) => {
    if (num >= 1e9) {
      return `$${(num / 1e9).toFixed(decimals)}B`;
    }
    if (num >= 1e6) {
      return `$${(num / 1e6).toFixed(decimals)}M`;
    }
    return `$${num.toLocaleString(undefined, {
      minimumFractionDigits: 2,
      maximumFractionDigits: 2,
    })}`;
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Crypto Price Tracker</h1>
      </header>
      <main className="table-container">
        <table className="crypto-table">
          <thead>
            <tr>
              <th>Rank</th>
              <th>Name</th>
              <th>Symbol</th>
              <th>Price</th>
              <th>24h Change</th>
              <th>Market Cap</th>
              <th>24h Volume</th>
            </tr>
          </thead>
          <tbody>
            {cryptos.map((crypto, index) => (
              <tr key={crypto.id} className={crypto.change24h >= 0 ? 'positive' : 'negative'}>
                <td>{index + 1}</td>
                <td className="name-cell">
                  <span className="crypto-name">{crypto.name}</span>
                </td>
                <td>{crypto.symbol}</td>
                <td>{formatNumber(crypto.price)}</td>
                <td className={`change-cell ${crypto.change24h >= 0 ? 'positive' : 'negative'}`}>
                  {crypto.change24h.toFixed(2)}%
                </td>
                <td>{formatNumber(crypto.marketCap)}</td>
                <td>{formatNumber(crypto.volume24h)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </main>
    </div>
  );
}

export default App;
